import { Entry } from "../../types"

interface Props {
    entry: Entry
}

const Entries = ( { entry }: Props ) => {
    return(
        <div>
                <p>{entry.date} - {entry.description}</p>
                <p>Diagnosis codes:</p>
                {entry.diagnosisCodes?.map(c => <li key={c}>{c}</li>)}
        </div>
    );
};

export default Entries
